      greeting = "good morning"
    }else if(currdate >= 12 && currdate < 19){
      greeting = "good afternoon"
    }else{
      greeting = "good night"
}


reactDom.render(<>
  <div>
    <h1>hello arun solanki <span>{currdate}</span></h1>
